css:
.conflict-resolved {
  background: rgba(126, 127, 129, 0.08);
}
.conflict-ours {
  background: #9dd8a9;
}
.conflict-ours.cursor-line {
  background: #78c989;
}
.conflict-theirs {
  background: #8cc8fc;
}
.conflict-theirs.cursor-line {
  background: #5ab0fb;
}
.conflict-dirty {
  background: #6d630d;
}
.conflict-dirty.cursor-line {
  background: #9a8d13;
}
